    "2016-07-27T22:57:43.978010",nt"name": "the-ecological-history-of-the-malheur-harney-lakes-basin-oregon-phase-i-eocene-epoch-to-19",nt"isopen":
    false,nt"url": null,nt"notes": "The Malheur-Harney Lakes Basin is located
    in the northern portion of the inter-mountain region. There is no outlet to the
    sea and the only way any water leaves is by evaporation, which is characteristic
    of other regions in the Great Basin. There are three principal water sources that
    drain into the Harney Basin. The Silvies River has its headwaters in the Blue Mountains
    and drains about 1350 square miles, entering Malheur Lake from the north. The Donner
    and Blitzen River heads on Steens Mountain, which is in the southeast corner of
    the Basin, and drains a 1000 square mile area. This system flows north from the
    mountain, eventually emptying into Malheur Lake from the south. Silver Creek flows
    from the Blue Mountains and empties directly into Harney Lake, draining a 900 square
    mile region. The region today is characterized by sagebrush and junipers, and numerous
    rimrocks occur throughout the Basin. Presently the climate is semi-arid, but it
    has not always been that way: about 55 million years ago tropical forests covered
    the area. A drier trend began about 30 million years ago and continued until 3 million
    years, when the Pleistocene ice age began. In the late Pleistocene drier conditions
    returned until the climate became arid about 5000years ago. The purpose of this
    report is to describe the ecology of this region from the Eocene epoch to the present
